import { Pagination } from 'antd';
import { connect } from 'react-redux';

const PaginationModule = ({ title , defultData }) => {
  const onChangeEvent = (e) =>{
    console.log('e',e)
  }
  return(
    <div>
      <Pagination 
        defaultCurrent={1} 
        defaultPageSize={30} 
        onChange={onChangeEvent} total={430}>
      </Pagination>
    </div>
  )
}

export default connect(state => state)(PaginationModule)
